import React from "react";
import g3 from "../components/assets/g3.png";

const Section01 = () => {
  return (
    <div>
      <div
        style={{
          backgroundImage: `url(${g3})`,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          width: "100vw",
          height: "90vh",
          textAlign: "center",
        }}
      > 
      <h1 style={{paddingTop: '250px', fontFamily: 'Open Sans Semibold', fontSize: '68px', }}>Avokate: Anila Veizi</h1>
      <p style={{fontSize: '24px', color: 'red'}}>10 vite eksperienc ne fushen e avokatise!</p>
      </div>
    </div>
  );
};

export default Section01;
